import React from "react";
import { Link } from "react-router-dom"

const ProductPage = () => {
    return (
        <div>
            <h1>
                Product Page
            </h1>
            <br />
            <ul>
                <li>
                    <Link to = "/">ProductPage</Link>
                </li>
            </ul>
        </div>
    );
};

export default ProductPage;
